import React from "react";
import {
  SectionContainer,
  SectionTitle,
  SectionParagraf,
} from "./ContactMeElements";

const ContactMeComponent = () => {
  return (
    <SectionContainer>
      <SectionTitle> Where to find me? </SectionTitle>
      <SectionParagraf>
        {" "}
        You can find me on all this platforms and I am always willing to talk
        about anything{" "}
      </SectionParagraf>
    </SectionContainer>
  );
};

export default ContactMeComponent;
